import './App.css';
import CountdownTimer from './Components/CountdownTimer/CountdownTimer';
import Title from './Components/Title';

function App() {
  return (
    <>
      <Title />
      <div div style={{ backgroundImage: `url("https://pixabay.com/photos/christmas-background-flat-lay-1911637/")` }} className="App">
        <CountdownTimer
          countdownTimestampMs={1703453498536} />
      </div>
    </>
  );
}

export default App;

